import React from 'react';

const JayaRank = () => {
    return (
        <div>
            <h3></h3>
            <p></p>
            <div>
            <button>প্রবেশ করুন</button>
            <button> নিবন্ধন</button>
            </div>
        </div>
    );
};

export default JayaRank;
